import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="bg-gradient-to-r from-purple-600 to-indigo-600 text-white shadow-lg py-4 px-6 flex justify-between items-center">
      <h2 className="text-2xl font-bold tracking-wide">Gym Management</h2>
      
      <div className="flex gap-6">
        <Link to="/" className="hover:text-gray-200 transition duration-300">Login</Link>
        <Link to="/signup" className="hover:text-gray-200 transition duration-300">Signup</Link>
        <Link to="/dashboard" className="hover:text-gray-200 transition duration-300">Dashboard</Link>
        <Link to="/assignworkouts" className="hover:text-gray-200 transition duration-300">Assign Workouts</Link>
      </div>
    </nav>
  );
}

export default Navbar;
